import React, { Component } from "react";
import "./infobar.css";

class Infobar extends Component{
    constructor(prop){
        super(prop);
        this.state = {
            coin: []
        };
    }

    render(){

        let storing = this.state.coin.SYMBOL;
        return(
            <div>
            {storing}
            </div>
        )
    }
}

export default Infobar;
